class auth extends Component {

    login(){
        alert("login called")
    }

    render() { 
        return ( 
            <div>
                <div>
                    <input type="text" name="text" id="text"/>
                    <button onClick={()=>this.login()}></button>
                </div>
            </div>
         );
    }
}

export default auth;
